const SignIn = () => {
    useEffect(()=>{
        const sendRequest = async () => {
            const response = await fetch("https://localhost:8080/");
            const resData = await response.json();
            console.log(resData);
        }

    },[])
    return (<section> <h1>Sign In Page</h1> </section>);
}

